import json
import unittest

from ..src.app import app


class TestApp(unittest.TestCase):
    USERNAME_REQ = 'username'
    PASSWORD_REQ = 'password'
    IMAGE_REQ = 'image'

    def test_should_authorized_failed(self):
        face = ''
        username = 'username'
        password = 'password'
        request = json.dumps({'image': face, 'username': password, 'password': username})

        response = app.test_client().post(
            '/authorize',
            data=request,
            content_type='application/json',
        )

        data = json.loads(response.get_data(as_text=True))

        assert response.status_code == 200
        self.assertEqual(data['authorized'], "False")

    def test_should_authorized_suceeded(self):
        face = ''
        username = 'natalia.galda'
        password = '1234'
        request = json.dumps({'image': face, 'username': password, 'password': username})

        response = app.test_client().post(
            '/authorize',
            data=request,
            content_type='application/json',
        )

        data = json.loads(response.get_data(as_text=True))

        assert response.status_code == 200
        self.assertEqual(data['authorized'], "True")


if __name__ == '__main__':
    unittest.main()
